description:
BioloMix Automatic Bread Machine, Professional Bread maker with rich experience in the kitchen. A revolutionary heating element built into our  Bread maker changes the way you can bake at home. With perfectly browned crust every time, anyone can be a master baker.

    【1KG Capacity & 17 Customized Automatic Programs】BioloMix Bread Maker has settings for light, medium or dark crust, different loaf capacity from 500g, 750g and 1000g. It also has 17 programs to choose from (QUICK BREAD, WHOLE-WHEAT, GLUTEN FREE, JAM, etc.)

    【Intelligent Fruit and Nut Dispenser & Patented Non-stick Teflon Pan】The detachable fruit nut dispenser releases the ingredients automatically at the optimum time. Teflon Pan is designed to make the bread evenly baked and healthier for no chemicals.

    【Intuitive Button Panel Control & 15H Timer, 1H Automatic Warm-keeping Function】Intuitive button control is easy to use. 15-hour Delay Timer, 1-Hour Automatic Keep Warm, 15-minute Power Interruption Recovery allow for fresh breads anytime.

    【Sleek Stainless Steel Design for Healthy Freshly Baked Bread at Home】Attractive sleek stainless steel design and tempered glass cover blend in well with any kitchen decoration. Homemade bread is not only tastier but also healthier (fresher & less chemicals).

Product Advantages:
. Non-stick Teflon Pan: Healthier and dishwasher-safe;
. Removable automatic dispenser: dispense fruit, nuts at the right time;
. Lid and panel used tempered grass, more stylish and generous;
. The entire housing with brushed and no-fingerprint treatment stainless steel;
. One button control, use more easily;
. 650W AC motor, more stable, stronger and works longer;

Bread-making Operation Steps:
Simply add ingredients you love, select the cycle, and press start then the Bread Maker will take care of the baking.
①Material Ready→ ②Stir→ ③Raw Dough→④Ferment→⑤Dispense nut/Fruit→⑥Bake→ Bread completed.

Noted: the product comes with the 220V UK plug which commonly used in Malaysia
